INSERT INTO `v1_5471be705c3a4079bde23809daa75d312ca43fc5fc9c56474f39eed8ed7293de` VALUES (362, 33, 74006505, "全属性ボーナス特大アップ", "同属性のキャラが４体以上編成されているとき、キャラの属性ボーナスが強化される。");
